import { lineColorGenerator } from "../utils/colorGenerator.utils";
const edgesJson = require(".././data/json/edges.json");

export const initialEdges = edgesJson.map(({ source, ...edge }, _, array) => {
  if (source.includes("P")) {
    const numberValue= source.substring(1)
    const [r,g,b]=lineColorGenerator(numberValue, 16, 1);

   return { source, ...edge, style: {stroke: `rgba(${r},${g},${b})` } };
  }
  return { source, ...edge, type: "custom", connectedToSelected: false };
});
